import React from 'react';

const ExpenseTotal = props => {

    const totalExpensesValues = props.expenses.map(expense => expense.value);
    const totalExpenses = Math.reduce(...totalExpensesValues);

    return (
        <div>{totalExpenses}</div>
    );

};

export default ExpenseTotal;
